import { useEffect, useState } from "react";
//import axios from "axios";
import Card from "../Card/Card";
import { useSelector } from "react-redux";
import "./App.css";
import SearchBar from "../Search/SearchBar";
//const API = "http://localhost:3001/videogames/";

const Home = () => {
  const [videoGames, setVideoGames] = useState([]);

  const { allVideogames } = useSelector((state) => state);

  useEffect(() => {
    setVideoGames(allVideogames);
  }, []);

  return (
    <div className="App">
      <SearchBar />
      <main>
        {videoGames?.map((game) => {
          return (
            <Card
              key={game.id}
              id={game.id}
              name={game.nombre}
              image={game.imagen}
              plataforms={game.plataformas}
              genero={game.genero}
            />
          );
        })}
      </main>
    </div>
  );
};

export default Home;
